import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './PolicyList.css';

const UserList = () => {
  const [policies, setPolicies] = useState([]);
  const [claims, setClaims] = useState([]);
  const [expandedClaimId, setExpandedClaimId] = useState(null);
  const email = localStorage.getItem('email');

  useEffect(() => {

    axios.get(`http://localhost:8080/claim/${email}`, {
      headers: {
        'Authorization': 'Basic VGVhbTE6VGVhbTE='
      }
    })
    .then(response => {
      setClaims(response.data);
    })
    .catch(error => {
      console.error('There was an error fetching the claims!', error);
    });
  }, [email]);

  const handleEnroll = (policyName) => {
    axios.post('##api paste here##', { policyName, email }, {
      headers: {
        'Authorization': 'Basic YWRtaW4xMjM6Y21z'
      }
    })
    .then(response => {
      console.log('Enrollment successful:', response.data);
    })
    .catch(error => {
      console.error('There was an error enrolling in the policy!', error);
    });
  };

  const toggleDescription = (claimId) => {
    setExpandedClaimId(expandedClaimId === claimId ? null : claimId);
  };

  return (
    <div className='policy-list'>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Policy Name</th>
            <th>Coverage Amount</th>
            <th>Description</th>
          </tr>
        </thead>
        <tbody>
          {policies.map(policy => (
            <React.Fragment key={policy.id}>
              <tr onClick={() => toggleDescription(policy.id)} style={{ cursor: 'pointer' }}>
                <td>{policy.id}</td>
                <td>{policy.policyName}</td>
                <td>{policy.coverageAmount}</td>
                <td>
                  {expandedClaimId === policy.id ? (
                    <div>
                      <p>{policy.description}</p>
                      <button onClick={() => handleEnroll(policy.policyName)}>Enroll</button>
                    </div>
                  ) : (
                    <span>
                      {policy.description.length > 100 ? 
                        `${policy.description.substring(0, 100)}... ` : policy.description}
                      <span className="more-link" onClick={() => toggleDescription(policy.id)}>
                      </span>
                    </span>
                  )}
                </td>
              </tr>
            </React.Fragment>
          ))}
        </tbody>
      </table>
      <h2>Your Claims</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Policy Name</th>
            <th>Amount</th>
            <th>Status</th>
            <th>Date</th>
          </tr>
        </thead>
        <tbody>
          {claims.map(claim => (
            <React.Fragment key={claim.id}>
              <tr onClick={() => toggleDescription(claim.id)} style={{ cursor: 'pointer' }}>
                <td>{claim.id}</td>
                <td>{claim.policyName}</td>
                <td>{claim.amountClaimed}</td>
                <td>{claim.status}</td>
                <td>{claim.claimDate || 'N/A'}</td>
              </tr>
              {expandedClaimId === claim.id && (
                <tr>
                  <td colSpan="5">
                    <div>
                      <strong>Admin Remarks:</strong> {claim.adminRemarks || 'No remarks'}
                    </div>
                  </td>
                </tr>
              )}
            </React.Fragment>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UserList;
